    as the services are solely to help the committee comply with federal campaign
    finance laws; and, because the individuals performing the services are regular
    employees of the organization consistent with Commission regulations at 100.86.
    \ The value of those services is $1250.  As a result of an internal audit conducted
    as a result of the transition between treasurers of Kelley Drye & Warren PAC (the
    PAC), the PAC discovered a small number of 'un-cashed' contributions to Federal
    campaign committees.  In accordance with Federal Election Commission guidance,
    we have itemized these uncashed checks on Schedule B of this report. Please know
    that the PAC has made every effort to reconcile our books.   In addition, a reported
    Contribution to the Bart Gordon Committee on 6/10/2008 was acutally made to the
    Congressman Joe Barton Committee. The report has been amended to reflect proper
    attribution."
